import React, { Component } from 'react'

//Material UI
import Accordion from '@material-ui/core/Accordion';
import AccordionDetails from '@material-ui/core/AccordionDetails';
import AccordionSummary from '@material-ui/core/AccordionSummary';
import Typography from '@material-ui/core/Typography';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

class privacyPolicy extends Component {
    state = { //initiate state variables
        expanded: null,
    }
    render() {
        const handleChange = (panel) => (event, isExpanded) => {
            this.setState({
                expanded: isExpanded ? panel : false
            })
        };
        return (
            <div className="privacyPolicy">
                <Accordion expanded={this.state.expanded === 'panel1'} onChange={handleChange('panel1')}>
                    <AccordionSummary
                        expandIcon={<ExpandMoreIcon />}
                        aria-controls="panel1bh-content"
                        id="panel1bh-header"
                    >
                        <Typography>General settings</Typography>
                    </AccordionSummary>
                    <AccordionDetails>
                        <Typography>
                            Nulla facilisi. Phasellus sollicitudin nulla et quam mattis feugiat. Aliquam eget
                            maximus est, id dignissim quam.
                        </Typography>
                    </AccordionDetails>
                </Accordion>
                <h3>Complaints</h3>
                <p>If you have complaints regarding the way your protected health information was handled, you may submit a complaint in writing to our office. You will not be retaliated against in any manner for a complaint.</p>
            </div>
        )
    }
}

export default privacyPolicy
